import "./Card.css";
const Card = () => {
  return (
    <div className="card">
      <h1 className="card__header">A lifetime of discounts? It's Genius</h1>
      <p className="card__content">
        Get rewarded for your travels-unlock instant savings of 10% or more with
        a free account
      </p>
      <button className="card__button">Sign in/Register</button>
    </div>
  );
};
export default Card;
